DROP TABLE IF EXISTS `city`;
CREATE TABLE `city` (
  `code` varchar(20) NOT NULL COMMENT '行政区划编码',
  `name` varchar(200) NOT NULL COMMENT '名称',
  `shotname` varchar(100) DEFAULT NULL COMMENT '简称',
  `pinyin` varchar(200) DEFAULT NULL COMMENT '拼音',
  `jianpin` varchar(100) DEFAULT NULL COMMENT '简拼',
  `zipcode` varchar(20) DEFAULT NULL COMMENT '邮编',
  `lng` float DEFAULT NULL COMMENT '经度',
  `lat` float DEFAULT NULL COMMENT '纬度',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `parent` varchar(20) DEFAULT NULL COMMENT '上级区划',
  PRIMARY KEY (`code`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='市';

